.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"970828","type":"CustomJS"},{"attributes":{},"id":"970620","type":"BasicTicker"},{"attributes":{},"id":"970766","type":"BasicTicker"},{"attributes":{"coordinates":null,"data_source":{"id":"970458"},"glyph":{"id":"970732"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"970734"},"nonselection_glyph":{"id":"970733"},"view":{"id":"970736"}},"id":"970735","type":"GlyphRenderer"},{"attributes":{"data":{"equity_dd":{"__ndarray__":"AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/ASWE3skN8D9N3BB9nBzwP1TXYVpJk+8/65U9SBlh7z8ArwSPxZ/vPzNk5W1mke8/2RWK57lU7z8R8JiA7vLuP8BxuJ/jre4/ZuOa4dNT7j+e5HCgXi3uP6JavWx/A+4/rx/7DVUQ7j843vJPL3PuP7FRZNEeHe4/16IhdGvR7T/xnXxXFLjtPyAx+RIubO0/1g+05xJs7T+zdT7kt93tP5fJHRkXNe4/ZJIn9LKZ7T+dPp9UPeHsP5akEEnvEu0/QXyFIN7+7D80YvtM447sPw1XHkoTK+w/z2cTqlMq7D/8OOKLnansP490U2eK6ew/Adqa0MsI7T/FUygtSV7tPwlel8nH8ew/bm2pPQzo7D8/o0QeC9nsPzdkF4Qq8Os//0TttHXE6z/rr1nHXH3rP5hmhnhgc+s/p/mXTOhh6z8agVbhkf/qP/jlVvvJ7uo/LjckXU+u6j/JUQ0cTGrqP+bIWwDrYOs/ss7kSJPV6z8qKsz9QTTsP9NAY0UVHuw/7zL27t4E7D93AYl+mtfrP4/k8bGNIew/MEXyccPR6z+agu1Bt/DrP+Ofzlrntus/z4OnhnBy6z+fmBvhq4zrP1qIIffFles/naEPCSw/7D/hB6yDGATsP46JGJ+XFOw/s/dXBy+u6z+1tCOoZOjrP2mCnWRo+us/F7njoA9F7D/texLo7EXsP4YvY7BBK+w/2Rv4ca3f6z8LXO0MC6HrP0oEc0P2ous/yFyJqNiU6z/qqhdAE5HrP5EEi1OOQes/D06zpS9J6z/
